Chaka Khan (born Yvette Marie Stevens; March 23, 1953), frequently known as the 
&quot;Queen of Funk&quot;, is a 10-time Grammy Award winning American singer-songwriter who 
gained fame in the 1970s as the frontwoman and focal point of the funk band Rufus.

While still a member of the group in 1978, Khan embarked on a successful solo career. 
Her signature hits, both with Rufus and as a solo performer, include &quot;Tell Me Something 
Good&quot;, &quot;Sweet Thing&quot; which she wrote for her then husband Richard Holland, &quot;Ain't Nobody&quot;
&quot;I'm Every Woman&quot;, &quot;I Feel for You&quot; and &quot;Through the Fire&quot;.



